import React from "react"
import Contact from "./Contact";

const AboutMe = (props) => {
    return <div>
        {props.aboutMe && <div>
            {props.aboutMe}
        </div>}
        {props.lookingForAJob ?
            <div>
                Im looking for a job
            </div>
            :
            <div>
                Im have a job
            </div>}
        {props.lookingForAJobDescription &&
        <div>
            {props.lookingForAJobDescription}
        </div>
        }
        My contacts : {Object.keys(props.contacts).map(key=>{
        return <Contact key={key} ContactName={key} ContactValue={props.contacts[key]} />
    })}
    </div>
}

export default AboutMe
